package com.example.demo.modules.designPattern.sevice.builder;/** * @description: 汽车品牌 * @author: Mr.monster.liu * @create: 2021-06-17 11:57 **/public class AutomobileBrand implements AutomobileBrandInterface {    private Cart cart;    AutomobileBrand(){        this.cart = new Cart();    }    AutomobileBrand(Cart cart){        this.cart = cart;    }    @Override    public void setAutomobileBrandName(String name) {        this.cart.setAutomobileBrandName(name);    }    @Override    public Cart getCart() {        return this.cart;    }}